import styled from "styled-components";

export default function Points({ name, id, setLatitude, setLongitude, latitude, longitude, setSelectedPointName, setSelectedPointId }) {
    return (
        <Point onClick={() => { setLatitude(latitude); setLongitude(longitude); setSelectedPointName(name); setSelectedPointId(id) }}>
            <div>{name}</div>
            <ion-icon name="star-outline"></ion-icon>
        </Point>
    );
}

const Point = styled.div`
border: 2px solid red;
display: flex;
justify-content: space-between;
`
